import React, { Component } from "react";
import Logo from "./logo.png"

export default class HeaderAcc extends Component {
    render() {
        return (
            <header>
                <img src={Logo} alt="TSU Logo" />
                <input type="search" placeholder="Search" />
                
            </header>
        )
    }
}
